GETTING_STARTED.html.body:
Creating a simple rest API
In this tutorial, we will be using inceptum-swagger to create a TODO API that talks to a mysql database. 
Setting up our app
In this tutorial, we'll be using Typescript, because types are fun. All of this should work in plain javascript as well though!
We'll be basing our project off https://github.com/hipages/typescript-base, this provides a lot of the typescript configs
and dotfiles we'll need.
For this example, we'll be just-in-time transpliling it with ts-node. In production we would be pre compiling our code
to javascript, but this will be ok this purposes of this tutorial.
$ yarn global add ts-node
On Mac/*ix you will have to do this
$ sudo npm install ts-node -g
$ sudo npm install typescript -g
Now, lets add inceptum to our project...
$ yarn add inceptum
And use it to create our app:
// src/index.ts
import { InceptumApp } from 'inceptum';

const app = new InceptumApp();
app.start();

If you run ts-node src/index.ts you should see something like below.

It's complaining about not having any config, lets fix that!
Config
Lets create a file at /config/default.yml
app:
  name: My Todo App
  context:
    name: BaseContext
logging:
  streams:
    console:
      type: console
    myredis:
      type: redis
    mainLogFile:
      type: file
      path: main.log
  loggers:
    - name: ROOT
      streams:
        console: debug

 ts-node src/index.ts again... nice! Our app runs, but it doesn't actually do anything ...yet.
Swagger And Routing
Setting up the swagger plugin is easy! We just need to import the package and tell our App to use it.
Inceptum Web will set up our express server, and SwaggerPlugin will set up our routing via our swagger file.
// src/index.ts
import { InceptumApp, SwaggerPlugin, WebPlugin } from 'inceptum';
import * as path from 'path';

const swaggerPath = path.resolve(`${__dirname}/../config/swagger.yaml`);
const app = new InceptumApp();
app.use(new WebPlugin(), new SwaggerPlugin(swaggerPath))
app.start();

We now need to set up our swagger file where we will define our routes. This seems pretty long, but most of it is just 
boilerplate 
# /config/swagger.yaml
swagger: "2.0"
info:
  version: "0.0.1"
  title: ToDo sample application
host: localhost:10010
basePath: /
schemes:
  - http
  - https 
consumes:
  - application/json
produces:
  - application/json
paths:
  /todo/{id}:
    x-inceptum-controller: TodoController
    get:
      description: Gets one todo by id
      x-inceptum-operation: get(id)
      parameters:
       - name: id
         type: string
         required: true
         in: path
      responses:
        "200":
          description: Success
          schema:
            type: object

The intersting parts here are the custom attributes we've defind x-inceptum-controller and x-inceptum-operation.
The attributes are basically defining what method we are going to call on what controller, as well as what paramaters
we are going to pass to that method.
Finally, we need to let inceptum know where to find out controllers. To do this, we can add the following line to our
index.js.
// src/index.ts
import { InceptumApp, SwaggerPlugin, WebPlugin } from 'inceptum';
import * as path from 'path';

const swaggerPath = path.resolve(`${__dirname}/../config/swagger.yaml`);
const app = new InceptumApp();
app.addDirectory(path.resolve(`${__dirname}/controller`));  // 
Here we are using node's built-in path module to point inceptum to our controllers located at /src/controllers
We can now write our controller!
// src/controller/TodoController.ts
export default class TodoController {

  async get(id, req, res) {
    return res.send({
      id: id,
      done: false
    });
  }

}

Now, if you start your app and go to http://localhost:10010/todo/1234 in your browser you should receive the following JSON response:
{
  "id": 1234,
  "done: false
}

Cool! But static data isn't really useful. Lets add a database!
Adding a database
To add a database connection to our app, all we need to do is add the following to our config.yml. Inceptum will automatically 
create a MysqlPlugin() (// TODO LINK) to our application. It will be registered under the name MainMysqlClient to the IoC container.
#config/default.yml
# ... other configs
mysql: # Telling inceptum to add a new MysqlPlugin() to our app
  MainMysqlClient: # IoC name
    master:
      max: 10
      min: 1
      connectionConfig:
        host: localhost
        port: 3306
        user: root
        password:
        database: testDb
        charset: utf8

You'll notice that we've added a master conifg. We can also add a slave config that Inceptum will use if we want a read only
transaction, like so:
#config/default.yml
# ... other configs
mysql:
  MainMysqlClient: # this is the name of the object that will be exposed in the context
    master:
      max: 10
      min: 1
      connectionConfig:
        host: localhost
        port: 3306
        user: root
        password:
        database: testDb
        charset: utf8
    slave:
      max: 10
      min: 1
      connectionConfig:
        host: localhost
        port: 3306
        user: root
        password:
        database: testDb
        charset: utf8

Feel free to edit the mysql config use a valid username/password so it can connect on your local.
In this example both connections are pointing to the same place, but in production we can change this to point to a read only replica or user.
Connecting everything together
To talk to our database, we're going to create a Service class.
// src/service/TodoService.ts
export default class TodoService {

  getTodo(id) {
    // TODO Implement me!
  }

}

Here, we're going to tell inceptum that we want access to the mysql client we just set up in the service we just created.
To do this, we define a static property on our class to tell inceptum what dependencies we want to be injected.
// src/service/TodoService.ts
export default class TodoService {

  static autowire = {
    mysql: 'MainMysqlClient',
  };

  getTodo(id) {
    // TODO Implement me!
  }
}

We can now use the client in our service like below:
// src/service/TodoService.ts
export default class TodoService {
  mysql: any;

  static autowire = {
    mysql: 'MainMysqlClient',
  };

  async getTodo(id) {
    return this.mysql.runInTransaction(true, async (client) => {
      const [todo] = await client.query(`SELECT * FROM todos WHERE id = ?`, id);
      return todo;
    });
  }
}

Finally, we need to tell Inceptum that these service classes exist:
// src/index.ts
import { InceptumApp, SwaggerPlugin, WebPlugin } from 'inceptum';
import * as path from 'path';

const swaggerPath = path.resolve(`${__dirname}/../config/swagger.yaml`);
const app = new InceptumApp();
app.addDirectory(path.resolve(`${__dirname}/controller`));
app.addDirectory(path.resolve(`${__dirname}/service`)); // 
Now, we need to wire up our service to our controller, we do this in a similar way to mysql
// src/controller/TodoController.ts
export default class TodoController {
  service: any;

  static autowire = {
    service: 'TodoService',
  };

  async get(id, req, res) {
    const todo = await this.service.getTodo(id);
    res.send(todo);
  }
}

Finally, lets let up our database table so we can query it live, run this SQL on your local mysql server:
CREATE DATABASE testdb;
USE testdb;
CREATE TABLE `todos` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `done` bool DEFAULT false,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

INSERT INTO todos VALUES('1234',true);
If we hit http://localhost:10010/todo/1234 now, you should see data straight out of your database in JSON form. 
{
  "id": 1234,
  "done: true
}

Congrats! You have just created
your first REST API powered by Inceptum!

WRITING_PLUGINS.html.body:
Plugins
Inceptum does nothing on its own. Almost everything is done using either using internal plugins of 
by user made custom plugins. 
Writing your first Plugin
In this guide, we will explore how we can implement a plugin by our selves.
For this example, we will implement a fake logger based on the console.
In the real world, you will most likely use a proper logger like Winston or
Bunyan. We do this here only for introducing the concept of Inceptum Plugins. 
We will create two classes, one for doing the actual logging operations and
the other for registering the plugin with Inceptum. 
An inceptum plugin can do a lot of things, but for this example, we will
stick with the bare minimum. 
The Console Logger
Let's see what we want to do here. The logger would have 4 methods, 

debug
info
warn
error

We will disable certain types of logs based on the initial log-level configuration.
For example, if the log-level is set to warn, the logger will spit out warnings and 
errors only, while silently swallowing debug and info logs.
Step 1: Write the client
The client code is pretty simple. Let's call our logger, ConsoLogger
// ConsoLogger.js
const loglevelMap = {
  debug: ['debug', 'info', 'warn', 'error'],
  info: ['info', 'warn', 'error'],
  warn: ['warn', 'error'],
  error: ['error'],
};

export default class ConsoLogger {
  constructor(config) {
    // The corresponding logger config should define a property called `loglevel`
    this.loglevel = config.loglevel
  }

  debug(message) {
    this.printLog('debug', message);
  }

  info(message) {
    this.printLog('info', message);
  }

  warn(message) {
    this.printLog('warn', message);
  }

  error(message) {
    this.printLog('error', message);
  }

  printLog(type, message) {
    // Given the log type, if the loglevel map includes the corresponding type,
    // then we print the log, else just ignore
    if (loglevelMap[this.loglevel].includes(type)) {
      console[type](message); // This calls console.info, console.warn, ... respectively
    }
  }
}

Step 2: Writing the Plugin
The plugin should do 2 basic things,

Read the logger config from the yaml config file
Register the ConsoLogger in the inceptum Context

Once this is done and the Plugin is provided in the app, it can be used from any inceptum module
in the app. 
Now let's start writing the plugin. A plugin must have a name property, and can implement
one or both of willStart and didStart life-cycle hooks. The willStart hook will run before 
the Inceptum App starts, and the DidStart hook will run after the App starts. 
You will most likely use the willStart hook to initialize a client or a service
similar to this very example.
// ConsoLoggerPlugin.ts
import { BaseApp, Plugin, BaseSingletonDefinition } from 'inceptum';
import ConsoLogger from './ConsoLogger';

export default class ConsoLoggerPlugin implements Plugin {
  name = 'ConsoLoggerPlugin';

  willStart(app: BaseApp) {
    // This means that we will read a config with name `logger` from the config yaml files
    if (!app.hasConfig('logger')) {
      throw new Error('Failed to find logger configs');
    }

    // Get the inceptum app context
    const context = app.getContext();

    // Read the logger config
    const config = context.getConfig('logger');

    // Create the `ConsoLogger` client definition
    // The name given here, (i.e. 'ConsoLogger') will be used to get the client from the actual app
    const client = new BaseSingletonDefinition(ConsoLogger, 'MyConsoLogger');

    // Declare that the logger config we read above will be passed to the client constructor
    client.constructorParamByValue(config);

    // Register the logger client in the inceptum app context
    context.registerSingletons(client);
  }
}

Cool, we've written our plugin. Now let's use it in our app. 
Step 3: Define the logger configuration
Similar to how we defined the mysql configs in the Getting Started guide,
we need to provide the logger config as well. We only need to provide the
log-level for this example. Let's add the following entry to the default.yaml file,
logger:
  loglevel: warn

Step 4. Use the logger client
// index.ts
import { InceptumApp, WebPlugin } from 'inceptum';
import ConsoLoggerPlugin from './ConsoLoggerPlugin';

const app = new InceptumApp();

app.use(
  new WebPlugin(),
  new ConsoLoggerPlugin()
);

app.start()

Now we can use this from any inceptum module in our app. Let's use it in a service,
// AccountService.ts
import { Autowire } from 'inceptum';
import ConsoLogger from '../ConsoLogger';

export default class AccountService {
  // Here we Autowire the ConsoLogger client
  // based on the name we provided in the Plugin
  @Autowire('MyConsoLogger') logger: ConsoLogger;

  createAccount() {
    this.logger.error("Something went wrong!"); // This will output 'Something went wrong!'
    this.logger.info("Less important info"); // This will not output anything, since we set the log-level to `warn`
  }
}

That's it for this guide. Merry Inceptum!
